import React from 'react';
import logo from './logo.svg';
import './App.css';
import Character from './components/Character.jsx';
import Profile from './components/Profile.jsx';

const character = {
  name: 'Hal 9000',
  description: 'Good afternoon, gentlemen. I am a HAL 9000 computer.',
};

const profile = {
  text: 'The HAL (Heuristically programmed ALgorithmic Computer) 9000 computer is an artificial intelligence and the onboard computer on the spaceship Discovery 1. HAL 9000, more commonly called "Hal", became operational in the HAL plant in Urbana, Illinois, on January 12, 1992. His first instructor was Dr. Chandra.  He is the hidden main antagonist of 2001 and a major protagonist in 2010.',
}

function App() {
  return (
    <Character 
      name={character.name}
      description={character.description}
    />
  );
}

export default App;
